void Sound_Init(void){
	NVIC_ST_CTRL_R = 0;              			//release disable SysTick during setup
  NVIC_ST_RELOAD_R = 7256;  				 			// maximum reload value
  NVIC_ST_CURRENT_R = 0;                // any write to current clears it
	NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R & 0x00FFFFFF) | 0x400000000;		//set priority to 3
};

void Sound_Play(const uint8_t *pt, uint32_t count){
};

void Sound_Fly(void){
	NVIC_ST_CTRL_R = 0x7;                 // enable SysTick with core clock	
	idx2 = 0;
	flag = 2;
};

void Sound_Background(void){
	NVIC_ST_CTRL_R = 0x7;                 // enable SysTick with core clock
	flag = 1;
};

void SysTick_Handler() {	
	if(flag == 1) {
		DAC_Out(theme[idx]);		// output sin wave value
		idx = (idx + 1) % 45408;	// increment index
		} 
	else 
		if(flag==2) {	
		DAC_Out(release[idx2]);
		if(idx2 == 18049) {
			} else {
					idx2++;
			}
		}
}

